import React, { useState } from 'react';
import PdfUploader from './components/PdfUploader';
import QuestionAsker from './components/QuestionAsker';
import './App.css';

function App() {
    const [sessionId, setSessionId] = useState(null);

    return (
        <div className="App">
            <h1>PDF to ChatGPT App</h1>
            <PdfUploader setSessionId={setSessionId} />
            {sessionId && <QuestionAsker sessionId={sessionId} />}
        </div>
    );
}

export default App;
